  findMissingYoutubeInfo = function() {
    var idInfo, k, len, m, missingTitleCount, needsSave, v;
    console.log("Checking for missing Youtube info...");
    missingTitleCount = 0;
    needsSave = false;
    for (k in playlist) {
      v = playlist[k];
      idInfo = filters.calcIdInfo(k);
      if ((idInfo == null) || (idInfo.provider !== 'youtube')) {
        continue;
      }
      if (playlist[k].countPlay != null) {
        delete playlist[k]["countPlay"];
        needsSave = true;
      }
      if (playlist[k].countSkip != null) {
        delete playlist[k]["countSkip"];
        needsSave = true;
      }
      if ((v.title == null) || (v.thumb == null) || (v.duration == null)) {
        getYoutubeData(v);
        missingTitleCount += 1;
      } else if (v.artist == null) {
        splitArtist(v, false);
        needsSave = true;
      }
      if (v.added == null) {
        v.added = serverEpoch;
        needsSave = true;
      }
      if (trimAllWhitespace(v)) {
        needsSave = true;
      }
      if (v.tags == null) {
        v.tags = {};
        needsSave = true;
      }
      if (v.nsfw != null) {
        delete v.nsfw;
        v.tags.nsfw = true;
        needsSave = true;
      }
    }
    for (m = 0, len = queue.length; m < len; m++) {
      v = queue[m];
      if (v.countPlay != null) {
        delete v["countPlay"];
        needsSave = true;
      }
      if (v.countSkip != null) {
        delete v["countSkip"];
        needsSave = true;
      }
      if ((v.title == null) || (v.thumb == null) || (v.duration == null)) {
        getYoutubeData(v);
        missingTitleCount += 1;
      } else if (v.artist == null) {
        splitArtist(v, false);
        needsSave = true;
      }
      if (v.added == null) {
        v.added = serverEpoch;
        needsSave = true;
      }
      if (trimAllWhitespace(v)) {
        needsSave = true;
      }
      if (v.tags == null) {
        v.tags = {};
        needsSave = true;
      }
      if (v.nsfw != null) {
        delete v.nsfw;
        v.tags.nsfw = true;
        needsSave = true;
      }
    }
    if (needsSave) {
      savePlaylist();
    }
    return console.log(`Found ${missingTitleCount} missing Youtube info.`);
  };

  sanitizeUsername = function(name) {
    if (name != null) {
      name = name.replace(/[^a-zA-Z0-9# ]/g, "");
      name = name.replace(/ +/g, " ");
      name = name.replace(/^ */, "");
      name = name.replace(/ *$/, "");
      if (name.length === 0) {
        return void 0;
      }
      name = name.substring(0, 16);
    }
    return name;
  };

